  return (
    <Router>
      <NavigationBar />
      <Routes>
        <Route path="profile">
          <h1>Welcome!</h1>
        </Route>
        <Route path="/">

        </Route>
      </Routes><div className="App">
            {/* <img src={logo} className="App-logo" alt="logo" /> */}
            <Hero />
          </div>
    </Router>

  );
}

export default App;
